PathAway's powerful feature-set makes it useful for any off-road GPS activity such as aviation, boating, off-road driving, hiking, cycling, touring, Geocaching, rally racing, motorcycle touring, running and athletic training, ballooning, fishing, hunting, paragliding, mountain climbing, ultra-light flying, canoeing, snowmobiling, scuba diving, outdoor education, mapping/GIS, mining, military training, surveying, site inspection, telematics, field data collection, search and rescue, or any application where location is important. 

Features: 
- Tried and tested software base developed with user feedback over the last 10 years;

Maps: 
- Use online maps from OpenStreetMap, OpenCycleMap, USGS Topos; 
- Maps are downloaded on-the-fly as you travel; 
- Maps can be cached for off-line use when connectivity is not available; 
- Import and use customized PathAway maps created using PathAway or 3rd party Tools;

Tracking: 
- perform extensive GPS track logging limited only by system memory; 
- Pause and continue track timer for precision timing; 
- One touch "BackTrack" feature to find your way home after recording your way out; 
- Manage and Edit Track logs and track points; 
- Share location with others, monitor their location on the map.

Points: 
- Capture points, describe by name, icon, description, photo; 
- Over 100 icons to choose from; 
- Manage and Edit Points; 
- Organize your points by creating multiple Points Databases; 

Navigation: 
- Navigate using point-to-point or multi-point routes; 
- Create navigational routes simply be tapping on the map to add or insert route points; 
- Proximity to point and off-track Alarms; 
- Auto Rotate maps to direction of travel
- Uses build-in magnetic compass for slow speed directional location. Great for Geocaching when you’re trying to pin-point a cache.. 
- View navigational information on a customizable dashboard; 
- Map View or Compass and Info Views; 
- Multiple coordinate grid and datum display including lat/long, UTM, OSGB, MGRS, MGA, GGRS87, Warschauer, Localized Grids for Austria, Germany, Quebec, Sweden, Switzerland, Israel. 

- Import/Export GPX, KML, KMZ, and PathAway delimited files. 

- For advanced features and location sharing, see PathAway PRO is available as stand-alone or in-app upgrades.

NOTE: Continued use of GPS running in the background can decrease battery life. Background processing can be configured in the Settings dialog.

PathAway is the ultimate App for outdoor navigation, tracking, route planning, and mapping activities such as boating, hiking, flying, cycling, running, touring, geocaching, racing, athletic training, ballooning, fishing, hunting, paragliding, mountain climbing, canoeing, snowmobiling, scuba diving. Professionals use PathAway for mapping/GIS, mining, military training, surveying, site inspection, field data collection, search and rescue, or any activity where location is important.

There are No Limits.

The great outdoors have no limits, so why should your App? PathAway PRO has everything from recording an unlimited number of tracks, create and import unlimited number of routes to navigate, track an unlimited number of friends, assets, or pets, create or import an unlimited number of your own maps, or use the automatically downloaded maps, capture an unlimited number of location points and annotate them with pictures and descriptions. You can even modify the screens and map overlays to suit your specific purpose. Even if you go beyond the limits of cell towers, PathAway will still retain your maps and data.

Designed for Robust Use

We’ve been developing GPS Apps for mobile devices for over 15 years, based on user feedback and recommendations. The creative design of PathAway PRO has grown to be the companion you can trust to get you out there, and to bring you back safely. Its time-proven core engine manages all the monitoring and recording data efficiently and robustly. You can count on PathAway Pro to handle the most challenging tasks in the Outdoors.

Unparalleled Versatility

PathAway’s features have been carefully designed to embrace the widest range of activities in the field. PathAway PRO is designed to handle activities from navigating a tight waterway, to traversing a mountain trail, to mapping property, to collecting wildlife data. 

Users have their Say

"Perfect for Off-Road Navigation!”, “Best GPS App yet!I”, "All other programs have fallen behind now! So just super. Now, the dream tool is here!!", " The cool thing is that you can layer maps and switch between them. I have used this for flight, boating and hiking." 
(For additional reviews go to http://pathaway.com)

It’s An Evolution

PathAway PRO’s feature-set has built on the success of the LE and Express Editions currently on the market. Of significance, PathAway PRO enables users to send their location to others, and to monitor where others are, right on their handheld unit. Locations can be sent and received directly to other devices, or sent to a central tracking service. This makes PathAway ideal for activities such as group travel, search and rescue operations, competitive sports, or people and asset tracking.

